import React from 'react';
import BlogsManager from '../components/dashboard/BlogsManager';

const BlogsPage = () => {
  return (
    <div style={{ padding: '20px' }}>
      <h1>Blog Management</h1>
      <BlogManager />
    </div>
  );
};

export default BlogsPage;
